function handleEditAvatarClick() {
  const editAvatarPopup = document.querySelector(".popup_type_avatar");
  editAvatarPopup.classList.add("popup__visible");
}

function handleEditProfileClick() {
  const editAvatarPopup = document.querySelector(".popup_type_edit");
  editAvatarPopup.classList.add("popup__visible");
}

function handleAddPlaceClick() {
  const editAvatarPopup = document.querySelector(".popup_type_add");
  editAvatarPopup.classList.add("popup__visible");
}

function Main() {
  return (
    <main className="content">
      <div className="profile">
        <div className="profile__container">
          <div className="profile__overlay-container">
            <div className="profile__overlay"></div>
            <img
              className="profile__picture"
              alt="Foto del perfil"
              src="/images/jacques_cousteau.jpg"
              onClick={handleEditAvatarClick}
            />
          </div>
          <div className="profile__info">
            <div className="profile__wrapper">
              <h1 className="profile__name">Cousteau</h1>
              <button
                className="profile__edit-button"
                onClick={handleEditProfileClick}
              >
                <img
                  src="/images/edit-button.svg"
                  alt="Logo de botón de editar"
                />
              </button>
            </div>
            <h2 className="profile__job">Explorador</h2>
          </div>
        </div>
        <button className="profile__add-button">
          <img src="/images/add-button.svg" alt="Logo de botón de eliminar" />
        </button>
      </div>
      <div className="elements">
        <ul className="elements__container"></ul>
      </div>
    </main>
  );
}

export default Main;
